// SPDX-License-Identifier: MIT
pragma solidity ^0.8.6;

contract Gambler {
    address private owner;
    Bet bet;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Must be owner");
        _;
    }

    function createBet(string calldata fighter, string calldata otherFighter)
        external
        onlyOwner
    {
        bet = Bet(address(0x0), fighter, otherFighter, gasleft());
    }

    struct Bet {
        address competitor;
        string fighterOne;
        string fighterTwo;
        uint256 gas;
    }
}
